	add("bascinet", "{\"term\":\"bascinet\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"French\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"Via Middle english (1100-1500) from Anglo-norman \u0027bacynet\u0027 from Old french (842-ca. 1400) \u0027bacinet\u0027 (little basin) diminutive of \u0027bassin\u0027 () Klein suggests an origin from French \u0027bercelonette\u0027 itself a double diminutive of \u0027berceau\u0027 (cradle) with influence from \u0027bassin\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A light helmet, at first open, but later made with a visor\", \"priority\":1}]}, \"synonyms\":{}}");

	add("baseball", "{\"term\":\"baseball\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|base|ball|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sport common in North America, the Caribbean, and Japan, in which the object is to strike a ball so that one of a nine-person team can run counter-clockwise among four bases, resulting in the scoring of a run. The team with the most runs after termination of play, usually nine innings, wins\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1797-1798\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was not very wonderful that Catherine, who had nothing heroic about her, should prefer cricket, \u0027\u0027base-ball\u0027\u0027, riding on horseback, and running about the country at the age of fourteen, to books\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The ball used to play the sport of baseball\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A variant of poker in which cards with baseball-related values have special significance\", \"priority\":5}]}, \"synonyms\":{}}");

