	add("baselard", "{\"term\":\"baselard\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027baselard, basilard\u0027 (early 14th century), in English from the later 14th century. Occurs in many spelling variants, including \u0027badelaire, baudelaire\u0027, Latinized \u0027badelare, bazelare, basalardus, balafardus, balasardus\u0027, etc.Probably in origin a corruption of German Basler (as \u0027pasler\u0027 also attested from the early 14th century), probably short for \u0027Basler messer\u0027 \u0026quot;knife of (made in, typical of) Basel\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a type of heavy dagger popular in the 14th and 15th centuries\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1380s\u0027\u0027: \u0026quot;Sir John and Sir Geoffrey hath a girdle of silver, a baselard or a ballok knyf with buttons overgilt.\u0026quot; (\u0027Piers Plowman\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1519\u0027\u0027: \u0026quot;a hoked Baslarde is a perelse wepon with the Turkes.\u0026quot; (\u0027Horman\u0027s Vulgaria\", \"priority\":3}]}, \"synonyms\":{}}");

