	add("bashlyk", "{\"term\":\"bashlyk\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Russian\", \"Turkish\"], \"text\":\"From Russian \u0027башлык\u0027 from Turkish \u0027başlık\u0027 \u0026lt;ref\u0026gt;[http://www.merriam-webster.com/dictionary/bashlyk \u0026quot;bashlyk.\u0026quot;] \u0027Webster\u0027s Third New International Dictionary, Unabridged.\u0027 Merriam-Webster. 2002.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A protective cone-shaped hood with lappets for wrapping around the neck, used especially by Turks and Cossacks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1962\u0027\u0027, Henri Troyat, \u0027Daily Life in Russia Under the Last Tsar\u0027, page 12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In winter the troops wore the grey greatcoat and the \u0027\u0027\u0027bashlyk\u0027\u0027\u0027, a sort of hood protecting the neck and ears\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027, Jacob Neusner, \u0027A History of the Jews in Babylonia\u0027, page 10\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The description of Jews wearing very high hats (\u0026quot;as tall as themselves\u0026quot; or \u0026quot;an \u0027amah\u0027 high\u0026quot;) calls to mind the tall pointed cap, or hood \u0027\u0027\u0027bashlyk\u0027\u0027\u0027 brought by the Iranians from the Siberian steppes. The \u0027\u0027\u0027bashlyk\u0027\u0027\u0027 occurs with great frequency among the Medean and Persian tribes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, E. Yarshater, \u0027The Cambridge History of Iran\u0027, volume 3(1), page 30\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The obverse bust wears a completely new style of \u0027\u0027bashlyk\u0027\u0027, resembling the Macedonian \u0027kausia\u0027, but with a flap at the back and an eagle on top\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Ferdinand Ossendowski, \u0027Beasts, Men and Gods\u0027, page 8\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Then one of the strangers mounted the throne, where he took off his \u0027\u0027bashlyk\u0027\u0027 or cap-like head covering. All of the Lamas fell to their knees as they recognized the man who had been long ago described in the sacred bulls of Dalai Lama, Tashi Lama and Bogdo Khan\", \"priority\":9}]}, \"synonyms\":{}}");

	add("basil", "{\"term\":\"basil\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Name of several early saints, particularly in the Orthodox Church, from Latin \u0027basilius\u0027 from Ancient greek (to 1453) \u0027βασίλειος\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"in quiet but steady use in the UK\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1866\u0027\u0027 Eliza Tabor Stephenson, \u0027Hester\u0027s Sacrifice\u0027, Hust and Blackett, 1866, Volume II, page 28\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Nonsense. I\u0027m sure he can\u0027t have grey hair with such a pretty name as that. \u0027\u0027Basil\u0027\u0027 Brooke, \u0027\u0027Basil\u0027\u0027 Brooke,\u0026quot; and May chanted the name over and over in her girlish, musical voice. \u0026quot;It sounds like all sorts of pleasant pictures\", \"priority\":3}]}, \"synonyms\":{}}");

	add("basin", "{\"term\":\"basin\", \"etymology\":{\"influencers\":[], \"languages\":[\"Welsh\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Irish\"], \"text\":\"From Middle english (1100-1500) {{m|enm|basin}}, from Old french (842-ca. 1400) {{m|fro|bacin}}, from {{m|la|*baccinum}}, from {{m|la|bacca||wine jug}}, from Gaulish from Proto-celtic {{m|cel-pro|*baski||bundle}} (compare Welsh {{m|cy|baich||load, burden}}, Irish {{m|ga|bac||hindrance}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bowl for washing, often affixed to a wall\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An area of land from which water drains into a specific river\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A rock formation scooped out by water erosion\", \"priority\":3}]}, \"synonyms\":{}}");

	add("basis", "{\"term\":\"basis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"{{PIE root|en|gʷem}}From Latin {{m|la|basis}}, from Ancient greek (to 1453) {{m|grc|βάσις}},\u0026lt;ref name\u003d\u0026quot;OED\u0026quot;\u0026gt;“[http://dictionary.oed.com/cgi/entry/50018109 basis]” listed in the \u0027\u0027Oxford English Dictionary\u0027\u0027 [2\u0026lt;sup\u0026gt;nd\u0026lt;/sup\u0026gt; Ed.; 1989]\u0026lt;/ref\u0026gt; from Proto-indo-european {{m|ine-pro|*gʷémtis}}, derived from Proto-indo-european {{m|ine-pro|*gʷem-}} (English {{m|en|come}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A starting point, base or foundation for an argument or hypothesis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An underlying condition or circumstance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Daniel Taylor, \u0027Danny Welbeck leads England\u0027s rout of Moldova but hit by Ukraine ban\u0027 (in \u0027The Guardian\u0027, 6 September 2013)[http://www.theguardian.com/football/2013/sep/06/england-moldova-world-cup-qualifier-matchreport\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Hodgson may now have to bring in James Milner on the left and, on that \u0027\u0027basis\u0027\u0027, a certain amount of gloss was taken off a night on which Welbeck scored twice but barely celebrated either before leaving the pitch angrily complaining to the Slovakian referee\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A regular frequency\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"You should brush your teeth on a daily \u0027\u0027basis\u0027\u0027 at minimum\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The flights to Fiji leave on a weekly \u0027\u0027basis\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Cars must be checked on a yearly \u0027\u0027basis\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"In a vector space, a linearly independent set of vectors spanning the whole vector space\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Amount paid for an investment, including commissions and other expenses\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A collection of subsets (\u0026quot;basis elements\u0026quot;) of a set, such that this collection covers the set, and for any two basis elements which both contain an element of the set, there is a third basis element contained in the intersection of the first two, which also contains that element\", \"priority\":11}]}, \"synonyms\":{}}");

	add("basicity", "{\"term\":\"basicity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|basic|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being basi\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The degree to which a substance is basi\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The number of replaceable hydrogen atoms in a molecule of an acid\", \"priority\":3}]}, \"synonyms\":{}}");

