	add("basilect", "{\"term\":\"basilect\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|basi|lect|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A variety of a language that has diverged greatly from the standard form, and is only considered suitable for very informal contexts by speakers; opposed to \u0027acrolect\u0027 and \u0027mesolect\", \"priority\":1}]}, \"synonyms\":{}}");

	add("basileiolatry", "{\"term\":\"basileiolatry\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027sc\u003dpolytonic\u0027 (\u0027basileios\u0027, “of the king”; from \u0027sc\u003dpolytonic\u0027 \u0027basileus\u0027, “king”) + English \u0027-latry\u0027 (from the Ancient greek (to 1453) \u0027sc\u003dpolytonic\u0027 \u0027latreia\u0027, “worship”); compare \u0027basileolatry\u0027 and \u0027basilolatry\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"of the\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1872\u0027\u0027, \u0027Sacristy\u0027 II, page 10, footnot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At Westminster the established religion is \u0027\u0027Basileiolatry\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, w:John Wickham John Wickham Legg, \u0027Missale Ad Usum Ecclesie Westmonasteriensis\u0027 III, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dDXpCAAAAIAAJ\u0026amp;q\u003d%2Bbasileiolatry\u0026amp;dq\u003d%2Bbasileiolatry\u0026amp;hl\u003den\u0026amp;ei\u003dqOJIToHgHoXA8QPF7smrBg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CC0Q6AEwAA page 1,407]\u0026lt;/span\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The “\u0027\u0027basileiolatry\u0027\u0027” which we are told is now the prevailing worship at Westminster seems to have begun in the middle ages\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1960\u0027\u0027, w:Johannes Johannes Quasten and w:Stephan Stephan Kuttner [eds.], \u0027Traditio\u0027 XVI, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dxP4sAAAAIAAJ\u0026amp;q\u003d%2Bbasileiolatry\u0026amp;dq\u003d%2Bbasileiolatry\u0026amp;hl\u003den\u0026amp;ei\u003dqOJIToHgHoXA8QPF7smrBg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d3\u0026amp;ved\u003d0CDcQ6AEwAg page 122]\u0026lt;/span\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"When…the Second Recension was revised, the revisers…took pains to give greater significance to the queen’s coronation.…Different as it was, the same spirit of \u0027\u0027basileiolatry\u0027\u0027 inspired the alternative version\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1963\u0027\u0027, Henry Gerald Richardson and w:G.O. George Osborne Sayles, \u0027The Governance of Mediaeval England\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003d5x0MAAAAIAAJ\u0026amp;q\u003d%2Bbasileiolatry\u0026amp;dq\u003d%2Bbasileiolatry\u0026amp;hl\u003den\u0026amp;ei\u003dqOJIToHgHoXA8QPF7smrBg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;ved\u003d0CDsQ6AEwAw page 142]\u0026lt;/span\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Already in the tenth century \u0027\u0027basileiolatry\u0027\u0027…was established in England. The king was God’s thegn, His vicar upon earth\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027 April 23rd, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[https://groups.google.com/groups/profile?hl\u003den\u0026amp;enc_user\u003dIaQYbRoAAABoKYc9YhB275J91iEb_YelR_y1D2D7z766Rar-WcaMAA\u0026amp;pli\u003d1 François R. Velde], \u0027[https://groups.google.com/group/alt.talk.royalty/topics?hl\u003den\u0026amp;pli\u003d1 alt.talk.royalty]\u0027, “[https://groups.google.com/group/alt.talk.royalty/browse_thread/thread/a332c923bf6d9cfb/65c97c26dbfed6a4?hl\u003den\u0026amp;ie\u003dUTF-8\u0026amp;q\u003d%2Bbasileiolatry\u0026amp;pli\u003d1 Re: Male Swedish Crown Prince?]”, [https://groups.google.com/group/alt.talk.royalty/msg/65c97c26dbfed6a4?hl\u003den\u0026amp;dmode\u003dsource\u0026amp;output\u003dgplain\u0026amp;pli\u003d1 message 25]\u0026lt;/span\u0026gt\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Maybe you have some half-baked mixture of feudal and absolutist theories in mind…and the \u0027\u0027basileiolatry\u0027\u0027 you display suggests so\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Julian Goodare and Alasdair A. MacDonald [eds.], \u0027Sixteenth-Century Scotland\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dgw8XAQAAIAAJ\u0026amp;q\u003d%2Bbasileiolatry\u0026amp;dq\u003d%2Bbasileiolatry\u0026amp;hl\u003den\u0026amp;ei\u003dqOJIToHgHoXA8QPF7smrBg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d6\u0026amp;ved\u003d0CEUQ6AEwBQ page 414]\u0026lt;/span\u0026gt\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Boyd’s ensuing burst of proud Scots patriotism quickly gives place to a flood of boundless \u0027\u0027basileiolatry\u0027\u0027 and optimism\", \"priority\":13}]}, \"synonyms\":{}}");

	add("basileolatry", "{\"term\":\"basileolatry\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027βασιλεύς\u0027 + English \u0027-latry\u0027 (from the Ancient greek (to 1453) \u0027λατρεία\u0027 \u0027latreia\u0027, “worship”); compare \u0027basilean\u0027 \u0027basileiolatry\u0027 and \u0027basilolatry\u0027 ategory:English words suffixed with -latry\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1850\u0027\u0027, w:August Dr Augustus Neander [aut.] and w:Joseph Joseph Torrey [tr.], \u0027General History of the Christian Religion and Church\u0027 III, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dDK5UAAAAYAAJ\u0026amp;pg\u003dPR17\u0026amp;dq\u003d%2Bbasileolatry\u0026amp;hl\u003den\u0026amp;ei\u003dmINPTuCjPI208QPT__nABw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CCsQ6AEwA\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%2Bbasileolatry\u0026amp;f\u003dfalse page xvii]\u0026lt;/span\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Against the Byzantine \u0027\u0027Basileolatry\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1938\u0027\u0027, w:Robert Robert Briffault, \u0027The Decline and Fall of the British Empire\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dPISRNA1ZZSsC\u0026amp;q\u003d%2Bbasileolatry\u0026amp;dq\u003d%2Bbasileolatry\u0026amp;hl\u003den\u0026amp;ei\u003dmINPTuCjPI208QPT__nABw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d2\u0026amp;ved\u003d0CDEQ6AEwAQ pages 114–115]\u0026lt;/span\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Before the Reform Bill anything resembling the neurosis of English \u0027\u0027Basileolatry\u0027\u0027 was even more completely un\u0026lt;!-- hyphenated here as “un-known” across a page break in the source --\u0026gt;known\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027 May 15th, “\u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[https://groups.google.com/groups/profile?hl\u003den\u0026amp;enc_user\u003dHFg08BIAAAD9zVadLlQngODw2YwLTmVupbyajUBv9M9XLUB2gqkZmQ David]”, \u0027[https://groups.google.com/group/alt.talk.royalty/topics?hl\u003den\u0026amp;pli\u003d1 alt.talk.royalty]\u0027, “[https://groups.google.com/group/alt.talk.royalty/browse_thread/thread/31fc4c28ffcbcf59/7778b8358e66eb37?hl\u003den\u0026amp;ie\u003dUTF-8\u0026amp;q\u003d%2Bbasileolatry\u0026amp;pli\u003d1 Re: New Scottish Government Affirm First Loyalty is to People of Scotland!]”, [https://groups.google.com/group/alt.talk.royalty/msg/7778b8358e66eb37?hl\u003den\u0026amp;dmode\u003dsource\u0026amp;output\u003dgplain message 8]\u0026lt;/span\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"If Ludovicus intends to mean “worship paid to a king in the manner of a god”…then he should know that (1) the constructive stem of the Latin word for “king” (rex) is reg-, not regio- (regius means “royal”; regia is a palace or royal court); and (2) since -latry comes from Greek -latreia, the first part of the compound should be Greek as well – presumably **\u0027\u0027basileolatry\", \"priority\":7}]}, \"synonyms\":{}}");

	add("basileus", "{\"term\":\"basileus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027βασιλεύς\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A title of the Byzantine emperor\", \"priority\":1}]}, \"synonyms\":{}}");

	add("basilica", "{\"term\":\"basilica\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027basilica\u0027 from Ancient greek (to 1453) {{m|grc||tr\u003dbasilike}}, from {{m|grc||tr\u003dbasilike stoa||royal hall}}, ultimately from \u0027βασιλικός\u0027 (royal) from \u0027βασιλεύς\u0027 (king, chief)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Christian church building having a nave with a semicircular apse, side aisles, a narthex and a clerestory\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A Roman Catholic church or cathedral with basilican status\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An apartment provided in the houses of persons of importance, where assemblies were held for dispensing justice; hence, any large hall used for this purpose\", \"priority\":3}]}, \"synonyms\":{}}");

	add("basilisk", "{\"term\":\"basilisk\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) \u0027basilique\u0027 from Latin \u0027basiliscus\u0027 from Ancient greek (to 1453) \u0027βασιλίσκος\u0027 (royal, imperial) from \u0027βασιλεύς\u0027 (king)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mythical (and heraldic) snake-like dragon type, reputed to be so venomous that its gaze was deadly\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The deadly look of the \u0027\u0027basilisk\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A type of dragon used in heraldry\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A tree-dwelling type of lizard of the genus\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A type of large brass cannon\", \"priority\":5}]}, \"synonyms\":{}}");

	add("basilolatry", "{\"term\":\"basilolatry\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027βασιλεύς\u0027 + English \u0027-latry\u0027 (from the Ancient greek (to 1453) \u0027λατρεία\u0027 \u0027latreia\u0027, “worship”); compare \u0027basileiolatry\u0027 \u0027basileolatry\u0027 \u0027basilic\u0027 and \u0027basilisk\u0027 ategory:English words suffixed with -latry\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1876\u0027\u0027, w:Henry Henry Kingsley, \u0027\u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://www.archive.org/stream/firesidestudies01kinggoo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"page/n4/mode/2up Fireside Studies]\u0027 I, “The Old-Fashioned Member”, [http://books.google.co.uk/books?id\u003d2VJLAAAAIAAJ\u0026amp;q\u003d%2Bbasilolatry\u0026amp;dq\u003d%2Bbasilolatry\u0026amp;hl\u003den\u0026amp;ei\u003dqolPTrqtJsbE8QOFw8nQBw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d5\u0026amp;ved\u003d0CD4Q6AEwBA page 261]\u0026lt;/span\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"91;w:Samuel Parker (bishop of Bp Samuel\u0026amp\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"93; Parker has been more than usually offensive in his \u0027\u0027Basilolatry\u0027\u0027 (if we may coin a word), and \u0026amp\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"91;w:Andrew Andrew\u0026amp\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"93; Marvell says, “His Majesty” (it would seem) “may lay by his \u0027Dieu\u0027, and make use only of his \u0027mon droit\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, \u0027w:The The Month\u0027 C, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dEUcaAQAAIAAJ\u0026amp;q\u003d%2Bbasilolatry\u0026amp;dq\u003d%2Bbasilolatry\u0026amp;hl\u003den\u0026amp;ei\u003di9RPTrrINIeV8QP-5e3VBw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d6\u0026amp;ved\u003d0CEIQ6AEwBQ page 89]\u0026lt;/span\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The fact is that there is not in the Roman liturgy…any of the extravagant \u0027\u0027basilolatry\u0027\u0027 which we find in the Book of Common Prayer\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1904\u0027\u0027, w:Louise Imogen Louise Imogen Guiney, \u0027w:Robert Robert Emmet\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dPKYDAAAAYAAJ\u0026amp;q\u003d%2Bbasilolatry\u0026amp;dq\u003d%2Bbasilolatry\u0026amp;hl\u003den\u0026amp;ei\u003di9RPTrrINIeV8QP-5e3VBw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;ved\u003d0CDoQ6AEwAw page 68]\u0026lt;/span\u0026gt\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Individualism…was not quite at its best in the self-righteous era of George the Third, and under the Establishment which was regulated by a now almost obsolete \u0027\u0027basilolatry\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1904\u0027\u0027, Louise Imogen Guiney, \u0027w:Richard Hurrell Hurrell Froude\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dDVtCAAAAIAAJ\u0026amp;q\u003d%2Bbasilolatry\u0026amp;dq\u003d%2Bbasilolatry\u0026amp;hl\u003den\u0026amp;ei\u003di9RPTrrINIeV8QP-5e3VBw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d3\u0026amp;ved\u003d0CDYQ6AEwAg page 214]\u0026lt;/span\u0026gt\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"His animus…led him to handle as self-evident fallacies the darling predilections of centuries of British \u0027\u0027basilolatry\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1914\u0027\u0027, w:Wilfrid Philip Wilfrid Ward [ed.], \u0027w:Dublin Review (Catholic The Dublin Review\u0027 CLIV, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dbLAYAQAAIAAJ\u0026amp;q\u003d%2Bbasilolatry\u0026amp;dq\u003d%2Bbasilolatry\u0026amp;hl\u003den\u0026amp;ei\u003di9RPTrrINIeV8QP-5e3VBw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d7\u0026amp;ved\u003d0CEUQ6AEwBg page 250]\u0026lt;/span\u0026gt\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Why Thomas Cromwell himself should have contrasted his “mean parentage” with his “high estate,” except out of sheer servility of spirit, out of what has been called \u0027\u0027basilolatry\u0027\u0027, the saving dread of the Tudors, is not apparent\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, w:Aidan Aidan Nichols, \u0027The Panther and the Hind\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dG9P3Yx0eq4EC\u0026amp;pg\u003dPA24\u0026amp;dq\u003d%2Bbasilolatry\u0026amp;hl\u003den\u0026amp;ei\u003di9RPTrrINIeV8QP-5e3VBw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CCsQ6AEwA\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%2Bbasilolatry\u0026amp;f\u003dfalse page 24]\u0026lt;/span\u0026gt\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The ‘\u0027\u0027basilolatry\u0027\u0027’ or king-worship which came to disfigure the Prayer Book stands in marked contrast to the sober intercessions of the Roman liturgy of the period for both emperor and king\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, w:Richard Richard Henry Popkin, “Grégoire’s American Involvements”, essay 8 in \u0027The w:Henri Abbé Grégoire and His World\u0027, eds. Jeremy D. Popkin and Richard Henry Popkin, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dLlTiQHiD_SsC\u0026amp;pg\u003dPA159\u0026amp;dq\u003d%2Bbasilolatry\u0026amp;hl\u003den\u0026amp;ei\u003di9RPTrrINIeV8QP-5e3VBw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d2\u0026amp;ved\u003d0CDAQ6AEwA\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%2Bbasilolatry\u0026amp;f\u003dfalse page 159]\u0026lt;/span\u0026gt\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"The calling of the Sanhedrin raised Grégoire’s concern about what he called \u0027\u0027Basilolatry\u0027\u0027, the attempt to deify a ruler\", \"priority\":20}]}, \"synonyms\":{}}");

	add("basinet", "{\"term\":\"basinet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"bascinet\", \"priority\":1}]}, \"synonyms\":{}}");

	add("basket", "{\"term\":\"basket\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"From Anglo-norman {{m|fro|bascat}}, from {{m|la|bascauda||kettle, table-vessel}}, from w:Common Brittonic|Common Brittonic, from Proto-celtic {{m|cel-pro|*baski||bundle, load}}, from Proto-indo-european {{m|ine-pro|*bʰask-||bundle}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Baskets four thumb|A tray and three wicker \u0027\u0027baskets\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A lightweight container, generally round, open at the top, and tapering toward the bottom\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A wire or plastic container similar in shape to a basket, used for carrying articles for purchase in a shop\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In an online shop, a notional place to store items before ordering them\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A circular hoop, from which a net is suspended, which is the goal through which the players try to throw the ball\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The act of putting the ball through the basket, thereby scoring points\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The game of basketball\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A dance movement in some line dances, where men put their arms round the women\u0027s lower backs, and the women put their arms over the mens\u0027 shoulders, and the group (usually of four, any more is difficult) spins round, which should result in the women\u0027s feet leaving the ground\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Genitals\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In a stage-coach, two outside seats facing each other\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1773\u0027\u0027, w:Oliver Oliver Goldsmith, \u0027s:She Stoops to She Stoops to Conquer\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"In my time, the follies of the town crept slowly among us, but now they travel faster than a stage-coach. Its fopperies come down not only as inside passengers, but in the very \u0027\u0027basket\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A protection for the hand on a sword or a singlestick; a guard of a bladed weapon\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A singlestick with a basket hilt\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1773\u0027\u0027, w:Oliver Oliver Goldsmith, \u0027s:She Stoops to She Stoops to Conquer\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Baw! damme, but I\u0027ll fight you both, one after the other——with \u0027\u0027baskets\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Where the pilot and passengers are\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.guardian.co.uk/books/2013/may/18/falling-upwards-richard-holmes-review Fantasy of passage\u003dLike most human activities, ballooning has sponsored heroes and hucksters and a good deal in between. For every dedicated scientist patiently recording atmospheric pressure and wind speed while shivering at high altitudes, there is a carnival barker with a bevy of pretty girls willing to dangle from a \u0027\u0027basket\u0027\u0027 or parachute down to earth\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The bell or vase of the Corinthian capital\", \"priority\":19}]}, \"synonyms\":{}}");

